import React from "react";

// https://opentdb.com/api.php?amount=6&category=18&difficulty=easy
export default async function Quiz(props) {
    const [questions, setQuestions] = React.useState([])

    let res = await fetch("https://opentdb.com/api.php?amount=6&category=18&difficulty=easy&type=multiple")
    let data = await res.json()
    setQuestions(data.results)

    return (
        <p>{questions[0].value}</p>
    )
}
